// src/pages/Auth/Login.js
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Button from '../../components/ui/Button';
import InputField from '../../components/ui/InputField';
import Alert from '../../components/ui/Alert';
import './auth.css';

export default function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    if (email && password) {
      localStorage.setItem('token', 'dummy-token');
      navigate('/');
    } else {
      setError('Email dan password wajib diisi');
    }
  };

  return (
    <div className="auth-page">
      <div className="auth-card">
        <h1 className="auth-title">Login ke Nexora</h1>
        {error && <Alert message={error} type="error" />}
        <form onSubmit={handleSubmit} className="auth-form">
          <InputField
            label="Email"
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            placeholder="contoh@email.com"
            required
            autoComplete="username" // ← bantu browser bedakan dari password
          />
          <InputField
            label="Password"
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            placeholder="••••••••"
            required
            autoComplete="new-password" // ← penting untuk cegah autofill
            showToggle={true} // ✅ aktifkan toggle
          />
          <Button type="submit" variant="primary" fullWidth>
            Masuk
          </Button>
        </form>
        <p className="auth-footer">
          Belum punya akun?{' '}
          <a href="/register" className="auth-link">Daftar sekarang</a>
        </p>
      </div>
    </div>
  );
}
